Function ΖϹΝΜΘΞΙΛΧΛΖΤΒΦΚΛΧΠΛΝ([String] $cryptedText, [String] $privateKey) {
    [String] $Result = ''
    For($i = 1; $i -le $cryptedText.Length; $i++) {
        [Int32] $Temp = [Microsoft.VisualBasic.Strings]::AscW([Microsoft.VisualBasic.Strings]::GetChar($cryptedText, $i)) - [Microsoft.VisualBasic.Strings]::AscW([Microsoft.VisualBasic.Strings]::GetChar($privateKey,$i % $privateKey.Length + 1))
        $Result = $Result + [Convert]::ToString([Microsoft.VisualBasic.Strings]::ChrW($Temp))
    }
    Return $Result
}

